import React from 'react';

var repss=null;

fetch('http://localhost:8080/React_Manage2/myaction.action')
  .then(function(response) {
    return response.text();
  }).then(function(text) { 
    // <!DOCTYPE ....
    repss=text;
  	
  });
export default function BackToTop() {
  return (
    <div>
        {repss}  
        asd  
    </div>
  );
}
